import React from 'react'
import Form from './Form'
import './List.css'

function Lists( setTodos, todos) {
  return (
    <div className='list'>
        <div className='todo-list-created' >
                {todos.map((todo, index) => (

                  <Todo 
                  text={todo.text}
                  setTodos={setTodos}
                  todo={todo}
                  todos={todos}
                  index={index}
                  />
                ))} 
              </div>    
        <div>
            <Form />
        </div>
    </div>

  )
}

export default Lists
